value = system.db.runNamedQuery('Event/ParticipantEvents/Registration/Get_Locations')
locationList = []
selected_locationId = self.params.locationId
if value.getRowCount() > 0:
	for i in range(0,value.getRowCount()):
		location = value.getValueAt(i,'name')
		location_id = value.getValueAt(i,'id')
		if selected_locationId != None and selected_locationId != '' and selected_locationId != -1:
			if selected_locationId == location_id:
				locationList.append(location)
			else:
				pass
		else:
			locationList.append(location)
return locationList
